import React, { useState, useCallback } from 'react';
import { Form, List, Button, Checkbox} from 'antd';
import styled from 'styled-components';

const CenterDiv = styled.div`
    width: 50%;
    margin : 0 auto;
    margin-top: 20px;
`;

const CustomBtn = styled(Button)`
    width: auto;
    float: right;
`;

const data = [{
    id: 1,
    content: '돈 500만원 모으기',
}, {
    id: 2,
    content: '살 70Kg 만들기'
}];

const EditUser = () => { 
    return (
        <Form>
            <CenterDiv>
                <List
                header={<div><h3 style={{display: "inline-block"}}>BucketList</h3><CustomBtn type="primary" shape="round">추가</CustomBtn></div>}
                style={{overflow: 'hidden'}}
                size="small"
                bordered
                dataSource={data}
                renderItem={item => <Checkbox style={{display: 'inline'}}><List.Item>{item.content}<CustomBtn danger type="link">삭제</CustomBtn></List.Item></Checkbox>}
                />
            </CenterDiv>
        </Form>
    );
}

export default EditUser;
